 "borderRadius": 0,
 "minHeight": 1,
 "propagateClick": false,
 "scrollBarColor": "#000000",
 "paddingLeft": 10,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:30px;font-family:'Calibri';\"><B>Sejarah Periode Awal (Pada Tahun 1740)</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Sejarah munculnya Kawasan Pecinan Semarang pada lokasi yang sekarang dimulai kira-kira tahun 1628, ketika komunitas Tionghoa di Simongan ikut serta dalam pemberontakan melawan Kerajaan Mataram yang diperintah oleh Souw Pan Djiang. Kerajaan Mataram saat itu diperintah oleh Sunan Mataram yang memihak pada VOC. Masyarakat Tionghoa terpaksa pindah ke daerah di bawah pengawasan VOC yang dikelilingi sungai (Kali Semarang) di sebelah utara, timur dan selatan. Sebelah barat berupa ruang terbuka. Rumah tinggal masih sedikit sehingga hanya pada batas-batas kawasan saja, yaitu Pecinan Lor, Pecinan Kidul, dan Pecinan Kulon sehingga menyisakan ruang terbuka di tengah kawasan. Pola jalannya masih belum terorganisir.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Belanda (VOC) tetap memegang kunci pemerintahan dan mengatur segala unsur dalam Kota Semarang, sedangkan masyarakat Tionghoa bertindak sebagai mediator dengan kaum pribumi terutama dalam sektor industri dan perdagangan. Kali Semarang pada masa itu merupakan urat nadi dalam transportasi dan menjadi unsur penunjang perdagangan yang penting karena menguhubungkan Kota Lama sebagai pusat pemerintahan dan Pecinan sebagai pusat perdagangan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:30px;font-family:'Calibri';\"><B>Sejarah Periode Pertengahan (Pada Tahun 1740-1742)</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Periode tahun 1740 hingga 1742, merupakan satu tahap perkembangan Kawasan Pecinan sebagai kota terisolasi, terutama karena benteng kayu yang dibangun mengelilingi kawasan. Pada bulan November 1740, terjadi kerusuhan di Batavia karena pembunuhan \u00b110.000 orang Tionghoa oleh Belanda dengan alasan pencegahan kedatangan orang Tionghoa lebih lanjut. Kerusuhan ini terjadi selama kurang lebih delapan hari dan berakibat pemberontakan masyarakat Tionghoa di Batavia. Orang-orang Tionghoa tersebut kemudian melarikan diri ke Semarang bersama Kapten Kwee An Say. Kapten Kwee mengumpulkan 10.000 ribu orang untuk membuat benteng yang terbuat dari balok dan papan kayu mengelilingi Pecinan Kulon, daerah yang paling rawan terhadap serangan dari luar (kini daerah ini bernama Beteng). Tahun itu juga beteng rubuh dan Kapten Kwee tertangkap VOC.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:30px;font-family:'Calibri';\"><B>Sejarah Periode Modern (Pada Tahun 1742 - Sekarang)</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Pada masa revolusi setelah kemerdekaan Republik Indonesia, Kota Semarang terus bergolak menjadi perjuangan pemuda dan rakyat dalam melawan penjajah. Hal ini berakibat pada porak porandanya kehidupan kota dan masyarakatnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Pada tanggal 19 Juni 1976, Kota Semarang mengalami pemekaran yang semula hanya terdiri dari 5 kecamatan menjadi 9 kecamatan ditambah dengan 4 kecamatan. Kemudian tahun 1996, Kodya Semarang yang semula terdiri dari 9 kecamatan dijadikan 16 kecamatan dengan penambahan 7 kecamatan baru.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Dalam perkembangan Kota Semarang, kampung-kampung di pusat pemukiman masyarakat Tionghoa juga tampak hidup karena berdekatan dengan pusat perdagangan. Populasi masyarakat Tionghoa menjadi semakin banyak, sehingga lokasi tempat tinggal juga meluas, tidak terbatas pada Kawasan Pecinan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Saat ini pemukiman Tionghoa makin berkembang keluar tanpa meninggalkan pusat niaganya di tengah Kota Semarang yang strategis.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
